public class Solution {
    public int MakeTheIntegerZero(int num1, int num2) {
        if (num2 == 0) return num1 == 0 ? 0 : -1;
        int operations = 0;
        while (num1 != 0) {
            if (operations > 60) return -1; // Prevent infinite loop
            int i = 0;
            while (i <= 60) {
                long power = 1L << i;
                if (power + num2 > num1) break;
                i++;
            }
            if (i > 0) i--;
            num1 -= (1 << i) + num2;
            operations++;
        }
        return operations;
    }
}
